import "./sidebar.css";

const Sidebar = () => {
  return (
    <div className="MainSidebar">
      <h2>Altre foto di Gattini:</h2>
      <img
        src="https://manualefaidate.com/files/593/gattino_cucciolo_gatto_rosso.jpg"
        alt="img"
      />
      <img
        src="https://manualefaidate.com/files/593/cuccioli_gatto.jpg"
        alt="img"
      />
    </div>
  );
};

export default Sidebar;
